./.body:
INTERF 
Interf is fast and small javascript library.
It makes possible to determine whether a object is an instantiated of a class that implements an interface.
And it is possible to copy class and class.prototype properties by :F: mix().in() too.

API symbols roadmap

:I: Interface
:C: Class
:A: Array
:S: String
:B: Boolean
:F: Function
:O: Object

Basic usage
// create interface
const Quackable = interf.create('Quackable');
// "implement" interface
const Duck = interf.implement(Quackable).in(class Duck {});
// create instance
const donald = new Duck();
// test instance
Quackable.isInterfaceOf(donald); // true

Download

:fa-download: Core build (~2kB gzipped)
:fa-download: Full build (~4kB gzipped)
:fa-cloud-download: CDN jsdelivr
:fa-cloud-download: CDN unpkg

Installation
Using npm:
$ npm install --save interf

In Node.js:
const interf = require('interf');

In a browser:


Configuration
// default configuration
interf.configure({
  warn: false,
  debug: false, // ignored in core build
  afterImplement: false,
  descriptor: {
    // value: (auto-defined,
    // in case when setter is defined will be auto-assigned),
    configurable: true,
    writable: false,
    enumerable: false,
    // set: undefined,
    // get: undefined,
  },
  callbacks: {
    warn: (data) => {
      if (typeof console === 'object' && console.warn) {
        console.warn(data.message);
      }
    },
    // ignored in core build
    debug: (data) => {
      if (typeof console === 'object' && console.log) {
        console.log(data.message, data);
      }
    },
    afterImplement: (classInterfaces, Class, interfaces) => {},
  },
  // ignored in core build
  mixin: {
    // warn: false, // if not defined, will be same as in parent scope
    // debug: false, // if not defined, will be same as in parent scope
    // callbacks: {}, // if not defined, will be same as in parent scope
    createInit: true, // create initMixins method in target prototype
    interfaces: true,
    replace: true,
    notConfigurableNotWritableError: true, // ignored if replace == false,
    ignore: {
      protoProps: [
        'constructor',
        'apply',
        'bind',
        'call',
        'isGenerator',
        'toSource',
        'toString',
        '__proto__',
      ],
      staticProps: [
        'arguments',
        'arity',
        'caller',
        'length',
        'name',
        'displayName',
        'prototype',
        '__proto__',
      ],
    },
  },
});

Support
Tested in:

:fa-chrome: Chrome 58 - 59
:fa-firefox: Firefox 54
:fa-internet-explorer: IE 9 - 11
:fa-safari: Safari 5.1.7
:fa-opera: Opera 45
:fa-server: Node.js 6
:fa-server: PhantomJS 2.1.14

License
Interf is released under the MIT license

api/core/create.html.body:
interf.create()
Description: Create new interface object.  


interf.create(interfaceName [, extends]);
return :I: new Interface();

interfaceNameType: :S: StringA interface name.

extendsType: :A: ArrayArray of extends interfaces.

Return valueType: :I: Interface (Object)Created interface  



interf.create(properties);
return :I: new Interface();

propertiesType: :O: PlainObject  
A map of properties to pass to the method.



Property name
Description




name
:S: String. A interface name


extends
:A: Array. Optional. Extends interfaces


/^[A-Z]+.*/
:-: Any. Optional. Any additional data (property name should start with capital latin letter)




Return valueType: :I: Interface (Object)Created interface  

Examples
const Flyable = interf.create('Flyable');

const Speakable = interf
    .create({
        name: 'Speakable',
        Comment: 'Main interface for speakable animals and humans',
        Methods: ['speak']
    });

const Quackable = interf.create('Quackable', [Flyable, Speakable]);

api/core/interface-isinterfaceof.html.body:
Interface.isInterfaceOf()
Description: Tests whether an object in its prototype chain has interface in __interfaces_ property.


Interface.isInterfaceOf(object);
return :B: true|false;

InterfaceType: :I: Interface (Object)Interface to test against.

objectType: :O: ObjectThe object to test.

Return valueType: :B: BooleanTest result  

Examples
// create interface
const Quackable = interf.create('Quackable');
// implement interface
const Duck = interf.implement(Quackable).in(class Duck {
    instanceOf(target) {
        if (typeof target.isInterfaceOf === 'function' &&
            target.isInterfaceOf(this)) return true;
        return typeof target === 'function' &&
            this instanceof target;
    }
});
// create object
const donald = new Duck();

// test object by Interface.isInterfaceOf()
Quackable.isInterfaceOf(donald); // true

// test object by own method
donald.instanceOf(Quackable) // true

api/core/remove-in.html.body:
interf.remove().in()
Description: Remove interfaces from class.


interf.remove(Interface1[, Interface2[, ...[, InterfaceN]]]).in(target);
return :B: true|false;

InterfaceNType: :I: InterfaceA interface.  

targetType: :C: Class or :O: Class.prototypeClass from which or class prototype from which constructor will be interfaces removed.

Return valueType: :B: BooleanResult of removing



interf.remove(interfacesArray[, options]).in(target);
return :B: true|false;

interfacesArrayType: :A: ArrayArray of interfaces.  

optionsType: :O: PlainObject  
A map of options to pass to the method.



Property name
Description




debug
:B: Boolean. Optional. (default: interf._config.debug) Option to call callbacks.debug (avialable only in full build)


callbacks.debug
:F: Function. Optional. (default: interf._config.callbacks.debug) Function that be called if debug is true (avialable only in full build)


warn
:B: Boolean. Optional. (default: interf._config.warn) Option to call callbacks.warn. It may be called in cases if some interfaces was not found in prototype interfaces or was removed but same interface still exist in parents prototypes interfaces or other interfaces parents


callbacks.warn
:F: Function. Optional. (default: interf._config.callbacks.warn) Function that be called if warn is true




targetType: :C: Class or :O: Class.prototypeClass from which or class prototype from which constructor will be interfaces removed.

Return valueType: :B: BooleanResult of removing

Examples
const Flyable = interf.create('Flyable');
const Quackable = interf.create('Quackable');

const Duck = interf.implement(Flyable, Quackable).in(class Duck {
    fly() {}
    quack() {}
});

delete Duck.prototype.fly;
interf.remove(Flyable).in(Duck); // true
interf.remove([Flyable], {warn: true}).in(Duck); // false & warn calling

delete Duck.prototype.quack;
interf.remove([Quackable], {debug: true}).in(Duck); // true
interf.remove(Quackable).in(Duck); // false

api/core/utils.html.body:
interf.utils
Description: Utilities functions of interf. May be usefull for somebody.


getProto(object)
polyfill for some old Opera browsers
// realization
interf.utils.getProto = Object.getPrototypeOf || (obj => obj.__proto__);

getSymbols(object)
get symbols, if method Object.getOwnPropertySymbols not provided, will return empty array
// realization
interf.utils.getSymbols = Object.getOwnPropertySymbols || (() => []);

addArray(target, source)
add source array elements to target array in fastest way (source array may be arguments array)
// usage
const target = [1,2];
const source = [3,4];
const result = interf.utils.addArray(target, source);
console.log(result); // [1,2,3,4]
console.log(target); // [1,2,3,4]
result === target // true

mergeObjects(target, source)
merge source object values in target object recursively, arrays merged by addArray (used for assignObjects())
// usage
const target = {
    debug: true,
    mixin: {
        warn: false,
    },
};
const source = {
    debug: false,
    warn: false,
};
const result = interf.utils.mergeObjects(target, source);
console.log(JSON.stringify(result)); // {debug: false, mixin: { warn: false }, warn: false}
console.log(JSON.stringify(target)); // {debug: false, mixin: { warn: false }, warn: false}
result === target // true

assignObjects(object1[, object2[, ...[, objectN]]]])
merge objects values in new obj, arrays merged by addArray, new empty object {} will be assigned firstly underhood (same speed as Object.assign(), but IE 9+ supported)
// usage
const object1 = {
    debug: true,
    mixin: {
        warn: false,
    },
};
const object2 = {
    debug: false,
    warn: false,
};
const result = interf.utils.assignObjects(object1, object2);
console.log(JSON.stringify(result)); // {debug: false, mixin: { warn: false }, warn: false}
console.log(JSON.stringify(object1)); // {debug: true, mixin: { warn: false }}
result === object1 // false

api/mixin/mix-in.html.body:
interf.mix().in()
Description: Mixin method. It exist many different mixins for JS objects and classes. They will not copy information about interfaces or will copy it incorrect. This is a reason why this method was writed. This method copy properties from sources to tatget class and prototype by Object.defineProperty(), exept not configurable properties (if property is not configurable but writable it will be copied by assign). This method provide initMixins method to every target prototype if createInit is set to true.


interf.mix([source1[, source2[, ...[, sourceN]]]]).in(target);
return :C: target|target.constructor;

sourceNType: :C: Class or :O: Class.prototypeA source class or source class prototype.

targetType: :C: Class or :O: Class.prototypeClass to which or class prototype to which constructor and prototype will be sets properties from source.

Return valueType: :C: ClassClass of target  



interf.mix(sourcesArray[, options]).in(target);
return :C: target|target.constructor;

sourcesArrayType: :A: ArrayArray of source classes or source classes prototypes.

optionsType: :O: PlainObject  
A map of options to pass to the method.



Property name
Description




debug
:B: Boolean. Optional. (default: interf._config.mixin.debug) Option to call callbacks.debug


warn
:B: Boolean. Optional. (default: interf._config.mixin.warn) Option to call callbacks.warn.


callbacks.debug
:F: Function. Optional. (default: interf._config.mixin.callbacks.debug)


callbacks.warn
:F: Function. Optional. (default: interf._config.mixin.callbacks.warn). It may be called in cases if some property will be replaced by new or ignored, or be ignored, because target property is not writable and not configurable.


createInit
:B: Boolean. Optional. (default: interf._config.mixin.createInit) Create initMixins method in target prototype. initMixins method will create objects (instances) of mixins and copy all objects properties to target object. MixinsInitiable interface will be added too.


interfaces
:B: Boolean. Optional. (default: interf._config.mixin.interfaces) Copy mixins sources interfaces to target.


replace
:B: Boolean. Optional. (default: interf._config.mixin.replace) If properties with same names will be found in target and mixin source, will be replaced by new (from mixin source, prefer last).


notConfigurableNotWritableError
:B: Boolean. Optional. (default: interf._config.mixin.notConfigurableNotWritableError) If replace is set to true and will be found property with same name and target property will be not configurable and not writable, property will be tryed to defined. This will throw Error. If false, property will be not tryed to defined, also Error will be not throwed.


ignore.protoProps
:A: Array. Optional. (default: interf._config.mixin.ignore.protoProps) Class proptotype properties names that will be ignored anyway. This array will be merged with array from config.


ignore.staticProps
:A: Array. Optional. (default: interf._config.mixin.ignore.staticProps) Class properties (static) names that will be ignored anyway. This array will be merged with array from config.




targetType: :C: Class or :O: Class.prototypeClass to which or class prototype to which constructor and prototype will be sets properties from source.

Return valueType: :C: ClassClass of target  

Examples
const MixinsInitiable = interf.interfaces.MixinsInitiable;
const Flyable = interf.create('Flyable');
const Quackable = interf.create('Quackable');

const Duck = interf.implement(Flyable, Quackable).in(class Duck {
    constructor(type) {
        this.wings = 2;
        this.type = type;
    }
    fly() {
        return 'fly';
    }
});
Duck.quack = () => 'quack';

const RedHeadDuck = interf.mix(Duck).in(class RedHeadDuck {
    constructor() {
        if (MixinsInitiable.isInterfaceOf(this)) {
        // or if (typeof this.initMixins === 'function') {
          const everyMixinConstructorArguments = ['animal'];
          this.initMixins(...everyMixinConstructorArguments);
        }
    }
});

const arnold = new RedHeadDuck();

arnold instanceof Duck // false
Flyable.isInterfaceOf(arnold) // true
Quackable.isInterfaceOf(arnold) // true
MixinsInitiable.isInterfaceOf(arnold) // true

arnold.fly(); // 'fly'
arnold.type === 'animal'; // true
arnold.wings === 2; // true
RedHeadDuck.quack() // 'quack'

