interf.debug([infoType1[, infoType2[, ...[, infoTypeN]]]]).in(target);
return :O: PlainObject;

infoTypeNType: :S: StringType of requested information, possible values: 'all', 'duplicates', 'tree', 'list'.

targetType: :C: Class or :O: Class.prototypeClass from which or class prototype from which constructor and wich parents will be information get.

Return valueType: :O: PlainObjectAccording to infoType`s will be contain appropriate information  



interf.debug(infoTypeArray).in(target);
return :O: PlainObject;

infoTypeArrayType: :A: ArrayArray of types of requested information, possible values: 'all', 'duplicates', 'tree', 'list'.

targetType: :C: Class or :O: Class.prototypeClass from which or class prototype from which constructor and wich parents will be information get.

